/** @format */

import React, { useEffect } from 'react';
import { Line, Doughnut, Bar } from 'react-chartjs-2';
import { useDispatch, useSelector } from 'react-redux';
import { dashboardForAdmin } from '../actions/adminActions';
import LoadingBox from '../components/LoadingBox';
import MessageBox from '../components/MessageBox';

function AdminDashboard(props) {
	const adminDashBoardInfo = useSelector((state) => state.adminDashBoardInfo);
	const { loading, dashboardInfo, error } = adminDashBoardInfo;

	console.log(dashboardInfo);

	const dispatch = useDispatch();
	useEffect(() => {
		dispatch(dashboardForAdmin());
		return () => {
			//
		};
	}, [dispatch]);

	const data = {
		labels: ['1', '2', '3', '4', '5', '6'],
		datasets: [
			{
				label: '# of Votes',
				data: [12, 19, 3, 5, 2, 3],
				fill: false,
				backgroundColor: 'rgb(255, 99, 132)',
				borderColor: 'rgba(255, 99, 132, 0.2)'
			}
		]
	};

	const data2 = {
		labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
		datasets: [
			{
				label: '# of Votes',
				data: [12, 19, 3, 5, 2, 3],
				backgroundColor: [
					'rgba(255, 99, 132, 0.2)',
					'rgba(54, 162, 235, 0.2)',
					'rgba(255, 206, 86, 0.2)',
					'rgba(75, 192, 192, 0.2)',
					'rgba(153, 102, 255, 0.2)',
					'rgba(255, 159, 64, 0.2)'
				],
				borderColor: [
					'rgba(255, 99, 132, 1)',
					'rgba(54, 162, 235, 1)',
					'rgba(255, 206, 86, 1)',
					'rgba(75, 192, 192, 1)',
					'rgba(153, 102, 255, 1)',
					'rgba(255, 159, 64, 1)'
				],
				borderWidth: 1
			}
		]
	};

	const options = {
		scales: {
			yAxes: [
				{
					ticks: {
						beginAtZero: true
					}
				}
			]
		}
	};

	return (
		<div className="">
			{loading ? (
				<LoadingBox></LoadingBox>
			) : error ? (
				<MessageBox variant="danger">{error}</MessageBox>
			) : (
				<div className="container">
					<div className="row">
						<div className="col-md-3">
							<p className="text-box">
								Number of Registered Users
								<h5>{dashboardInfo.registeredUsers}</h5>
							</p>
						</div>
						<div className="col-md-3">
							<p className="text-box">
								Number of Registered Farms <h5>{dashboardInfo.registeredUsers}</h5>
							</p>
						</div>
						<div className="col-md-3">
							<p className="text-box">
								Number of Products in Database <h5>{dashboardInfo.products}</h5>
							</p>
						</div>
						<div className="col-md-3">
							<p className="text-box">
								Number of Used Products <h5>{dashboardInfo.products}</h5>
							</p>
						</div>

						<div className="col-md-6">
							<p className="col-box">Number of Registered Farm Today</p>
						</div>
						<div className="col-md-6">
							<p className="col-box">Number of Registered Farm Today</p>
						</div>
					</div>
					<div className="col-md-6">
						<div className="mt-3">
							<p className="">Used Products</p>
							<Line data={data} options={options} />
						</div>
					</div>
					<div className="col-md-6">
						<div className="mt-3">
							<p className="">Users Registration</p>
							<Doughnut data={data} options={options} />
						</div>
					</div>
					<div className="col-md-12 mb-5 mt-5">
						<Bar data={data2} options={options} />
					</div>
				</div>
			)}
		</div>
	);
}

export default AdminDashboard;
